import React, { Component } from 'react'
import styles from './Hamburger.module.scss'

export default class Hamburger extends Component {
  state = {
    isOpen: false
  }

  render() {
    let hamburgerClass = this.state.isOpen ? ( styles.Hamburger + ' ' + styles.Hamburger__active ) : styles.Hamburger;

    let handleHamburgerClick = () => {
      this.setState({
        isOpen: !this.state.isOpen
      })
    }

    return (
      <div className={hamburgerClass} onClick={handleHamburgerClick}>
        <div className={styles.Hamburger__line + ' ' + styles.Hamburger__topLine}></div>
        <div className={styles.Hamburger__line + ' ' + styles.Hamburger__centerLine}></div>
        <div className={styles.Hamburger__line + ' ' + styles.Hamburger__bottomLine}></div>
      </div>
    )
  }
}
